import React from 'react';
import './Card.css';

const Card = ({ list }) => {
    return (
      <div className="flex">
        {list.map(({ name, image, salePrice, sku, url }) => (
          <div className="bg-gray-400 border-2 border-gray-800 m-4 w-64 h-80" >
          <a href={ url }><img className="h4" src={image} alt="Lens"></img></a>
          <h2>{ name } </h2>
          <h2>{ salePrice } </h2>
          <h3>SKU: { sku }</h3>
          </div>
        ))}
        
      </div>
    )
    
  }


export default Card;
